informacaoComplementar:
2.1 O Conselho Regional de Psicologia da 6ª Região (CRP06) promoveu o 1º Congresso de Psicologia Clínica do Estado de São Paulo, com o objetivo de fomentar a troca de experiências, disseminar boas práticas e promover a atualização técnica e científica dos profissionais da área. O evento, de caráter gratuito foi voltado exclusivamente aos profissionais de Psicologia regularmente inscritos no CRP-06;

2.2 Conforme processo SEI 570600306.000362/2024-08, o CRP 06 possui uma gráfica licitada (Publicidade Patriota Impressos em Geral Ltda) para produzir tais materiais. Fizemos a solicitação de todos os itens com antecedência, porém a gráfica não produziu nem entregou os materiais dentro do prazo estipulado, não respondendo aos e-mails, ligações e mensagens com transparência e assertividade acerca do andamento da produção;

2.3 Após constatar que a gráfica licitada não cumpriria o prazo e para garantir os materiais essenciais para o Congresso (de sinalização, identificação de participantes, orientação e informação), seguindo a orientação da GATI, a Unidade de Comunicação entrou em contato com diversas gráficas com objetivo de conseguir alguma com capacidade de produção dentro do prazo mínimo possível;

2.4 A contratação dos materiais de divulgação encontra respaldo na Lei nº 14.133/2021, que estabelece os princípios da administração pública, em especial: 

Princípio da Eficiência: Os itens contribuirão para a organização e a qualidade do evento, aumentando o impacto positivo junto aos participantes.

2.5 Desta forma, justificamos a contratação em caráter emergencial em razão de descumprimento de contrato por parte da empresa licitada, que acarreta em curto prazo para produção. Ressaltamos que os materiais produzidos são essenciais para: correta sinalização da programação e construção de credibilidade do evento junto ao público; identificação de trabalhadores, monitores e participantes; informação e orientação sobre atividades programadas e divulgação de eventos correlatos relevantes para a categoria;

objetoCompra:
Contratação de empresa(s) para a prestação de serviço técnico especializado para desenvolvimento e execução de pesquisa diagnóstica sobre a saúde biopsicossocial de servidores públicos do estado do Piauí, abrangendo aspectos físicos, psicológicos e sociais, com foco na identificação e escolha da solução mais adequada ao atendimento da necessidade administrativa apresentada.
O serviço a ser contratado deverá contemplar, de forma integrada, os seguintes eixos estruturantes:
- Mapeamento do perfil biopsicossocial dos servidores públicos estaduais;
-Produção de relatórios técnicos individualizados e institucionais;
-Subsídios para a formulação e implementação de programas de saúde;
-Prevenção de afastamentos e redução do absenteísmo;
-Desenvolvimento de soluções tecnológicas inovadoras;
-Promoção do bem-estar e da integração social dos servidores;
-Apoio à gestão estratégica de pessoas;
Assim, a presente iniciativa visa não apenas diagnosticar, mas também propor intervenções concretas que assegurem a melhoria das condições de trabalho e de saúde dos servidores estaduais, refletindo positivamente na eficiência, na motivação e na continuidade dos serviços prestados à sociedade. Trata-se, portanto, de medida necessária, oportuna e alinhada aos princípios constitucionais da eficiência, economicidade e supremacia do interesse público.
